(6992, 3210, 812, 7, 'judy''s too', '这首歌曲最有趣了，也是我们较早时期的一段生活经历。当动机完成后，我听着排练的录音，觉得特别象那种酒吧里的Party音乐，从音乐上来说也是最不象我们乐队风格的一首歌，于是我就想到了在上海茂名路上一个叫Judy’s Too的酒吧，我们曾经在那里演出过一段时间，那里一到周末人山人海，歌词里描写的也是我们看到和体会到的一些东西，在同样的复歌歌词里，我用了我、他、她三种人称，在喧闹奔放的外表下大家内心想的其实是同一个目的，去那里玩的人大同小异，老外、上海女孩加上我们。大家可以在同一首歌曲下面尽其所能的狂欢，我们演出间隙休息的时候在角落里去观察他们，会发现很有趣，就这样，灯红酒绿的你还想干嘛？ ', '2005-05-24 00:00:00', 0000, 0, 1, 7, 'Judy''s Too\r\n词：李乓 / 曲：水晶蝶 / 编曲：水晶蝶、肖楠\r\n\r\n嗨！\r\n我们今夜幻想在Judy''s Too\r\n没有一点点的约束\r\n控制不住兴奋的情感流露\r\n是谁送来这疯狂之舞\r\n说\r\n“迷迷糊糊之中\r\n让谁进入我的视线，我的记录\r\n迷迷糊糊之中\r\n带谁跟着Disco的节奏一起心跳”\r\n嘣！嘣！嘣！\r\n\r\n他们今夜坠落在Judy''s Too\r\n没有一点点的装束\r\n找个机会可以性感接触\r\n却没有真实可以看清楚\r\n说\r\n“迷迷糊糊之中\r\n让她进入我的视线，我的记录\r\n迷迷糊糊之中\r\n带她跟着Disco的节奏一起心跳”\r\n嘣！嘣！嘣！\r\n\r\n她们今夜沉没在Judy''s Too\r\n就象一颗海洋宝珠\r\n闪亮之身覆盖着沙土\r\n每一分种都寻找到深处\r\n说\r\n“我迷迷糊糊之中\r\n让他进入我的视线，我的记录\r\n迷迷糊糊之中\r\n带他跟着Disco的节奏一起心跳”\r\n嘣！嘣！嘣！\r\n\r\n主唱/贝司/和音：李乓\r\n吉他：汪文伟\r\n鼓：陈松\r\n键盘：肖楠\r\nSAX：富贵\r\n混音：刘一宁', '', 256, '', '水晶蝶', '李乓', '秋傲', '新蜂音乐', '', 1, 1, 0, '2008-07-16 04:08:24', '2015-03-12 13:33:51', '0000-00-00 00:00:00'),
(6993, 3210, 812, 8, '预言+模糊（Instrumental）', '预言：这是“911事件”发生以后写的一首作品，当时文伟也跟我提出乐队应该写这么一首歌，所以《预言》就是在那种环境中写出来的。我想同样是死亡，同样是灾难，有些能获得大家的帮助或被大家纪念，而有些就默默地消失了，甚至没人知道。我想在一个世界大家庭里，大家彼此之间的关系是如何的呢？小到你周围的人、你的爱情、你的朋友；大到种族、国家、信仰，如果彼此都有了信任，那么很多悲剧就不会发生。但事实上人们的这种善良的愿望其实根本就不可能实现，只要有人存在，那么一定避免不了灾难，人们承受着为自己利益的争斗带来的痛苦，权利掌握在少数人的手里，他们还称自己是社会精英，而为此付出代价的往往又是那些无辜的人，当你不能避免这些事件发生的时候，当你不知道灾难何时降临时，那你除了祈祷你还能做什么。我们有音乐，我们至少可以把我们的想法提供给拿到这张专辑的人，这首歌不是为了纪念，而是我们的一种表达方式。', '2005-05-24 00:00:00', 0000, 0, 1, 7, '预言\r\n词：李乓 / 曲：水晶蝶 / 编曲：水晶蝶、肖楠 \r\n\r\n这就是晚霞吗？\r\n有谁在随着人海浮沉\r\n有我\r\n这是真实的吧\r\n独自舞蹈在幽静的海面\r\n一切\r\n\r\n如果能停留住生命\r\n证实世纪末的冷酷预言\r\n此刻，能随我一起熔入\r\n这巨大城市的五光十色中\r\n旋转\r\n\r\n世上所有的未知部分\r\n都在你眼前飘然而过, 飘然而过\r\n在潮湿的风中\r\n望着世界呑下她的痛处\r\n祈求万能的阳光\r\n能发射出爱\r\n\r\n闭上眼时在一起\r\n问你是否愿意\r\n在我身边\r\n是否又在一起\r\n问你是否愿意，问你是否愿意\r\n与我在一起\r\n\r\n当悲欢距离这世界越来越遥远\r\n是否彼此信任\r\n当这一切距离昨天越来越遥远\r\n是否彼此信任', '', 688, '', '水晶蝶', '李乓', '秋傲', '新蜂音乐', '', 1, 1, 0, '2008-07-16 04:17:16', '2015-03-12 13:33:51', '0000-00-00 00:00:00'),
