(7022, 3254, 819, 5, 'When You''re Smiling', '', '2005-04-27 00:00:00', 0000, 20, 0, 15, '', 'When you''re smilin'' keep on smilin''\nThe whole world smiles with you\nAnd when you''re laughin'' oh when youre laughin''\nThe sun comes shinin? through\n\nBut when you?re cryin'' you bring on the rain\nSo stop your sighin ''be happy again\nkeep on smilin Cause when you''re smilin''\nThe whole world smiles with you\n\nOh when you''re smilin'' keep on smilin''\nThe whole world smiles with you\nAh when you''re laughin'' keep on laughin''\nThe sun comes shinin'' through\n\nNow when you''re cryin'' you bring on the rain\nSo stop that sighin'' be happy again\nkeep on smilin Cause when you''re smilin'' \nAnd the whole world smiles with you\n\nThe great big world will smile with\n\nThe whole wide world will smile with you', 184, '', '', '', '', '', '', 1, 1, 0, '2008-07-17 17:06:18', '2015-03-12 13:33:52', '0000-00-00 00:00:00'),
