(7031, 3254, 819, 13, 'What A Wonderful World', '', '2005-04-27 00:00:00', 0000, 20, 0, 15, '', 'I see trees of green........ red roses too \nI see em bloom..... for me and for you \nAnd I think to myself.... what a wonderful world. \n\nI see skies of blue..... clouds of white \nBright blessed days....dark sacred nights \nAnd I think to myself .....what a wonderful world. \n\nThe colors of a rainbow.....so pretty ..in the sky \nAre also on the faces.....of people ..going by \nI see friends shaking hands.....sayin.. how do you do \nThey''re really sayin......i love you. \n\nI hear babies cry...... I watch them grow \nThey''ll learn much more.....than I''ll never know \nAnd I think to myself .....what a wonderful world \n\n(instrumental break) \n\nThe colors of a rainbow.....so pretty ..in the sky \nAre there on the faces.....of people ..going by \nI see friends shaking hands.....sayin.. how do you do \nThey''re really sayin...*spoken*(I ....love....you). \n\nI hear babies cry...... I watch them grow \n*spoken*(you know their gonna learn \nA whole lot more than I''ll never know) \nAnd I think to myself .....what a wonderful world \nYes I think to myself .......what a wonderful world.', 315, '', '', '', '', '', '', 1, 1, 0, '2008-07-17 17:16:41', '2015-03-12 13:33:53', '0000-00-00 00:00:00'),
