(7156, 3262, 828, 13, 'Stardust', '', '2006-05-04 00:00:00', 0000, 20, 0, 5, '', 'And now the purple dusk of twilight time\nSteals across the meadows of my heart\nHigh up in the sky the little stars climb\nAlways reminding me that we''re apart\n\nYou wandered down the lane and far away\nLeaving me a song that will not die\nLove is now the stardust of yesterday\nThe music of the years gone by\n\nSometimes, I wonder why I spend\nThe lonely nights dreaming of a song\nThe melody haunts my reverie\nAnd I am once again with you\n\nWhen our love was new\nAnd each kiss an inspiration\nBut that was long ago, now my consolation\nIs in the stardust of a song\n\nBeside the garden wall when stars are bright\nYou are in my arms\nThe nightingale tells his fairy tale\n[ From: http://www.metrolyrics.com/stardust-lyrics-rod-stewart.html ]\nOf paradise where roses bloom\n\nThough I dream in vain\nIn my heart it always will remain\nMy stardust melody\nThe memory of love''s refrain\n\nWhen our love was new\nAnd each kiss an inspiration\nBut that was long ago, now my consolation\nIs in the stardust of a song\n\nBeside the garden wall when stars are bright\nYou are in my arms\nThe nightingale tells his fairy tale\nOf paradise where roses bloom\n\nThough I dream in vain\nIn my heart it always will remain\nMy stardust melody\nThe memory of love''s refrain\n\n', 357, '', '', '', '', '', '', 1, 1, 0, '2008-07-17 19:23:06', '2015-03-12 13:33:57', '0000-00-00 00:00:00'),
