(7168, 3258, 829, 7, 'Carmine meo', '', '2005-08-01 00:00:00', 0000, 20, 0, 15, '', 'Carmine sanati meo\nAdice praeceptis tuis\nMala sunt vicina bonis\nCrimina tanta remitto\nNauta qui traicis umbras\nOr attendi !\nQui nunc iacet horrida pulvis\nNon lacerarmi...\nDio, massisti !...\nAncora mi udi ?\nDalle braccia sue la vita mi concedi\nHoc perdidit ante puellas\nSon di lui !\nNon posso sdegnarlo\nNon posso più\nIn core, strano...\nI suoi accenti\nSon scolpiti... E lui nol sa !\nNon muovere, presso a te son io\nNon muovere, lo spavento al cuor\nNon muovere, sconto col sangue mio\nL''amor di te... L''amor di te\nNon ventosas addidit alas\nSorte cruda !\nD''eterne lacrime\nTrema il mio cuor\nLa mia sventura...\nÔ rimembranza !\nDalle braccia sue io non muovero\nNon muovere, presso a te son io\nNon muovere, lo spavento al cuor\nNon muovere, sconto col sangue mio\nL''amor di te... L''amor di te... Presso a te con io\nNon muovere, lo spavento al cuor\nNon muovere, sconto col sangue mio\nL''amor di te... L''amor di te\n', 256, '', '', '', '', '', '', 1, 1, 0, '2008-07-17 19:46:40', '2015-03-12 13:33:58', '0000-00-00 00:00:00'),
